import "./App.css";
import React, { useState } from "react";
import Autosuggest from 'react-autosuggest';
import axios from "axios";
import Login from "./Login";
import Register from "./Register";
import Book from "./Book";
import Viewbook from "./Viewbook";
import Appointment from "./Appointment";
import Home from "./Home";
import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBIcon,
  MDBFooter,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBBtn,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBCollapse,
} from "mdb-react-ui-kit";
import logo from './logo.jpg'
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  const [auth, setAuth] = useState(false);
  const [authemail, setAuthemail] = useState(false);
  // Function to check user authentication status
  async function checkAuthentication() {
    try {
      const authToken = localStorage.getItem('authToken');
      if (!authToken) {
        console.log('User is not authenticated');
        return;
      }
      const response = await fetch('/auth-endpoint', {
        headers: {
          Authorization: `Bearer ${authToken}`
        }
      });
      const data = await response.json();

      if (data.isAuthenticated) {
        console.log('User is authenticated');
        const authemail = localStorage.getItem('authemail');
        setAuthemail(authemail)
        setAuth(true)
      } else {
        console.log('User is not authenticated');
        setAuth(false)
      }
    } catch (error) {
      console.error(error);
    }
  }
  checkAuthentication()

  // handle logout 
  function handleLogout() {
    localStorage.removeItem('authToken');
    localStorage.removeItem('authemail')
    window.location.href = '/login';
    setAuth(false)
  }
  // Search Functionality
  const [value, setValue] = useState('');
  const [suggestions, setSuggestions] = useState([]);

  const getSuggestions = async (value) => {
    try {
      const response = await axios.get(`/api/doctors/search?q=${value}`);
      const doctors = response.data;
      const suggestions = doctors.map((doctor) => ({
        name: doctor.name,
        specialty: doctor.specialty,
      }));
      setSuggestions(suggestions);
    } catch (err) {
      console.error(err);
    }
  };

  const getSuggestionValue = (suggestion) => suggestion.name;

  const renderSuggestion = (suggestion) => (
    <div>
      <div>{suggestion.name}</div>
      <div className="text-muted">{suggestion.specialty}</div>
    </div>
  );

  const onSuggestionsFetchRequested = ({ value }) => {
    getSuggestions(value);
  };

  const onSuggestionsClearRequested = () => {
    setSuggestions([]);
  };

  const onSuggestionSelected = (event, { suggestionValue }) => {
    // handle suggestion selection
  };

  const inputProps = {
    placeholder: 'Search for a doctor',
    value,
    onChange: (event, { newValue }) => {
      setValue(newValue);
    },
  };

  const [showBasic, setShowBasic] = useState(false);
  return (
    <div className="App">

      {/* navbar */}
      <MDBNavbar expand="lg" light bgColor="light">
        <MDBContainer fluid>
          <MDBNavbarBrand href="/"><img
            src={logo}
            height='35'
            alt=''
            loading='lazy'
          /></MDBNavbarBrand>

          <MDBNavbarToggler
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
            onClick={() => setShowBasic(!showBasic)}
          >
            <MDBIcon icon="bars" fas />
          </MDBNavbarToggler>

          <MDBCollapse navbar show={showBasic}>
            <MDBNavbarNav className="mr-auto mb-2 mb-lg-0">
              <MDBNavbarItem>
                <MDBNavbarLink active aria-current="page" href="/">
                  Home
                </MDBNavbarLink>
              </MDBNavbarItem>
              {auth === false &&
                <MDBNavbarItem>
                  <MDBNavbarLink href="/login">Login</MDBNavbarLink>
                </MDBNavbarItem>
              }
              {auth === false &&
                <MDBNavbarItem>
                  <MDBNavbarLink href="/register">Register</MDBNavbarLink>
                </MDBNavbarItem>
              }

              <MDBNavbarItem>
                <MDBNavbarLink href="/viewbook">View Appointments</MDBNavbarLink>
              </MDBNavbarItem>

              <MDBNavbarItem>
                <MDBNavbarLink href="/book">Book Appointment</MDBNavbarLink>
              </MDBNavbarItem>

              <MDBNavbarItem>
                <MDBDropdown>
                  <MDBDropdownToggle tag='a' className='nav-link' role='button'>
                    More
                  </MDBDropdownToggle>

                  <MDBDropdownMenu>
                    <MDBDropdownItem>
                      {auth === true &&
                        <MDBBtn color="white" onClick={handleLogout} className="w-100">Logout</MDBBtn>
                      }
                    </MDBDropdownItem>
                  </MDBDropdownMenu>

                </MDBDropdown>
              </MDBNavbarItem>
            </MDBNavbarNav>


            <Autosuggest className="d-flex input-group w-auto"
              suggestions={suggestions}
              onSuggestionsFetchRequested={onSuggestionsFetchRequested}
              onSuggestionsClearRequested={onSuggestionsClearRequested}
              getSuggestionValue={getSuggestionValue}
              renderSuggestion={renderSuggestion}
              onSuggestionSelected={onSuggestionSelected}
              inputProps={inputProps}
            />



          </MDBCollapse>
        </MDBContainer>
      </MDBNavbar>

      {/* routes */}
      <Router>
        <Routes>
          <Route path="/" element={<Home authemail={authemail} />} />
          <Route path="/appbook/:username" element={<Appointment />} />
          {auth === false && <Route path="/login" element={<Login />} />}
          {auth === false && <Route path="/Register" element={<Register />} />}
          {auth === true && <Route path="/book" element={<Book />} />}
          {auth === false && <Route path="/book" element={<Login />} />}
          {auth === true && <Route path="/viewbook" element={<Viewbook />} />}
          {auth === false && <Route path="/Viewbook" element={<Login />} />}
        </Routes>
      </Router>


      {/* footer */}
      <br></br>
      <MDBFooter bgColor='dark' className='text-center text-lg-start text-muted'>
        <section className='d-flex justify-content-center justify-content-lg-between p-4 border-bottom'>
          <div className='me-5 d-none d-lg-block'>
            <span>Get connected with me on social networks:</span>
          </div>

          <div>
            <a href='mailto:naveedqadir0@gmail.com' className='me-4 text-reset'>
              <MDBIcon fab icon="google" />
            </a>
            <a href='https://www.linkedin.com/in/naveedqadir/' target="blank" className='me-4 text-reset'>
              <MDBIcon fab icon="linkedin" />
            </a>
